import React, { Component } from 'react'
import './NavBar.css'
import { useNavigate } from 'react-router-dom';



class NavBar extends Component {
  handleLoginClick = () => {
    this.props.navigate('/login');
  };

  render() {
    return (
      <nav className="navbar">
        <h1 className="navbar-heading">HotelShare.com</h1>
        <div className="button-group">
          <button className='b1' onClick={this.handleLoginClick}>Login</button>
          <button className='b1'>Register</button>
        </div>
        <div className="username-display">
          {this.props.username}
        </div>
      </nav>
    );
  }
}

const NavBarWithNavigate = () => {
    const navigate = useNavigate();
    return <NavBar navigate={navigate} username={username} />;
}

export default NavBarWithNavigate;
